import React from "react"

const ChildDataKaryawan = (props) => {
    return (
        <div>
           
                <table class="table">
                    <tr>
                    <th>no</th>
                    <th>Employee Id</th>
                    <th>Employee Name</th>
                    <th>SIsa Cuti</th>
                    </tr>
                    {
                props.data.map((key,i) => {
                    return (
                        <div>
                        <tr>
                        <td><h5>No:{i+1}</h5></td>
                        <td><h5>EmpId:{key.emp_id}</h5></td>
                        <td><h5>EmpName:{key.emp_fullname}</h5></td>
                        <td><h5>Emp_SisaCuti:{key.sisa_cuti}</h5></td>
                        </tr>
                        <button>Cuti</button>
                        <br/>
                        </div>
                            )
                        })
                    } 
</table>
        
       
    </div >
  )
};

export default ChildDataKaryawan;
